import React from "react";

const ErrHandling = ({ err_msg }) => {
  console.log(err_msg, "<<<<<<<<<<<");

  if (err_msg) return <p>{err_msg}</p>;
  return (
    <div>
      <h3>{err_msg}</h3>
    </div>
  );
};

export default ErrHandling;
